import axios from 'axios';
import React, { useState } from 'react';

function App() {
  const [fortune, setFortune] = useState('');

  const generateFortune = async () => {
    try {
      const response = await axios.post('https://api.openai.com/v1/completions', {
        model: 'text-davinci-003',
        prompt: 'Generate a fortune cookie sentence.',
        temperature: 0,
        max_tokens: 200,
      }, {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': 'Bearer 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',
        },
      });
      setFortune(response.data.choices[0].text);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <button onClick={generateFortune}>Generate Fortune</button>
      <p>{fortune}</p>
    </div>
  );
}

export default App;
